import React from 'react';
import { Routes, Route } from 'react-router-dom';
import PatientDashboard from './pages/PatientDashboard';

function App() {
  return (
    <Routes>
      <Route path="/" element={<PatientDashboard />} />
      <Route path="/patient/*" element={<PatientDashboard />} />
    </Routes>
  );
}
export default App;
